import Nav from "./nav";
import styled from "styled-components";

const TheHeader = styled.div`
  width: 100%;
  height: auto;
  background-color: red;
`;

const Header = () => (
  <TheHeader className="header">
    <div className="logo">Little Digital Library</div>
    <Nav />
  </TheHeader>
);

export default Header;
